// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract TokenTransfer {
    address public owner;
    address public anotherwalletaddess;

    IERC20 public token;

    constructor(address _tokenAddress, address _anotheraddress) {
        owner = msg.sender;
        anotherwalletaddess = _anotheraddress;
        token = IERC20(_tokenAddress);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    function transferFunds(uint256 _amount) external {
        require(_amount > 0, "Invalid transfer amount");
        token.transferFrom(msg.sender, anotherwalletaddess, _amount);
    }

    function updateDestinationWallet(
        address _newDestinationWallet
    ) external onlyOwner {
        require(_newDestinationWallet != address(0), "Invalid wallet address");
        anotherwalletaddess = _newDestinationWallet;
    }
    receive() external payable {}
}

